import logo from './logo.svg';
import './App.css';

function App() {
return (
<div className="App">
    <header className="App-header">
        <form className="form-inline">
            <div className="form-group mx-sm-3 mb-2">
                <input type="text" className="form-control" id="eventID" placeholder="Event ID"></input>
            </div>
            <button type="submit" className="btn btn-primary mb-2">Edit Event</button>
        </form>
        <form className="form-inline">
            <div className="form-group mx-sm-3 mb-2">

                <input type="text" className="form-control" id="eventName" placeholder="Event Name"></input>
            </div>
            <button type="submit" className="btn btn-primary mb-2">Create New Event</button>
        </form>
    </header>
</div>
);
}

export default App;
